    // seq length = nCodon * 3
    private BEASTObject[] initF3X4(int nTaxa, int nCodon, boolean symmetric, boolean verbose) {
        Alignment data = null;

        try {
            if (origAlig == null)
                data = getAlig128T500Codons(nTaxa, nCodon);
            else {
                data = filterAlig(origAlig, nTaxa, nCodon);
            }
        } catch (XMLParserException e) {
            e.printStackTrace();
        }

        // create Codon Alignment
        CodonAlignment codonAlignment = new CodonAlignment();
        codonAlignment.initByName("data", data, "dataType", "codon",
                "geneticCode", "vertebrateMitochondrial", "verbose", verbose);

//        String pi = "F3X4";
        SiteModel siteModel = getSiteModel(codonAlignment,"F3X4","0.3", "5", verbose);

        Tree tree = getTree(data, symmetric, false);
        // java tree likelihood only
        System.setProperty("java.only","true");

        return new BEASTObject[]{codonAlignment, siteModel, tree};
    }

    // =============== Standard likelihood ===============
    // return nano seconds
    private long[] benchmarkingStandard(int iteration, CodonAlignment codonAlignment,
                                        SiteModel siteModel, Tree tree) {
        // init time
        long start = System.nanoTime();

        TreeLikelihood likelihood = new TreeLikelihood();
        likelihood.initByName("data", codonAlignment, "tree", tree, "siteModel", siteModel);

        long standardInit = System.nanoTime()-start;

        double logP = 0;
        start = System.nanoTime();
        // more iterations to avoid 0 millisecond
        for (int i=0; i<iteration; i++) {
            logP = likelihood.calculateLogP();
        }
        // Get elapsed time in nanoseconds
        long timeStandard = System.nanoTime()-start;
        System.out.println("Standard tree likelihood: logP = " + logP);

        return new long[]{standardInit, timeStandard};
    }

    // =============== DA likelihood ===============
    // return nano seconds
    private long[] benchmarkingDA(int iteration, CodonAlignment codonAlignment,
                                  SiteModel siteModel, Tree tree) {
        int tipCount = tree.getLeafNodeCount();
        int siteCount = codonAlignment.getSiteCount();

        // init time
        long start = System.nanoTime();

        int internalNodeCount = tree.getInternalNodeCount();
        // vert MT stop codon states = 8, 10, 48, 50
        int[] stopCodons = codonAlignment.getGeneticCode().getStopCodonStates();
        System.out.println("Stop codon states " + Arrays.toString(stopCodons));

        InternalNodeStates internalNodeStates = new InternalNodeStates(internalNodeCount, siteCount);
        // internal nodes
        for (int i = tipCount; i < tree.getNodeCount(); i++) {
            int[] inSt = new int[siteCount];
            // states[][] may longer than siteCount, because it is created for all runs.
            System.arraycopy(states[i - tipCount], 0, inSt, 0, inSt.length);
            internalNodeStates.setNrStates(i, inSt);
        }

        DACodonTreeLikelihood daLikelihood = new DACodonTreeLikelihood();
        daLikelihood.initByName("data", codonAlignment, "tree", tree, "siteModel", siteModel,
                "internalNodeStates", internalNodeStates);

        long daInit = System.nanoTime() - start;

        double logPDA = 0;
        start = System.nanoTime();
        // more iterations to avoid 0 millisecond
        for (int i = 0; i < iteration; i++) {
            logPDA = daLikelihood.calculateLogP();
        }
        // Get elapsed time in nanoseconds
        long timeDA = System.nanoTime() - start;
        System.out.println("DA tree likelihood: DA logP = " + logPDA);

        return new long[]{daInit, timeDA};
    }


