    // vertebrateMitochondrial
    private int[][] generateInternalNodeStatesVertMT(Random generator, int tipCount, int siteCount) {
        System.out.println("Generate internal node states using VertMT : tips = " + tipCount + ", codon = " + siteCount );
        // internal nodes
        int[][] states = new int[tipCount-1][siteCount];

        for (int i=0; i < states.length ; i++) {
//            states[i] = new int[siteCount];
            // 0 - 63
            for (int j=0; j < states[0].length; j++) {
                states[i][j] = (int)(generator.nextDouble() * 64);
                // stop codon states in vertebrateMitochondrial
                while(states[i][j] == 8 || states[i][j] == 10 || states[i][j] == 48 || states[i][j] == 50)
                    states[i][j] = (int)(generator.nextDouble() * 64);
            }
        }
        return states;
    }


    public Alignment getAligFrom(String fileName) throws XMLParserException, IOException {
        String xml = "";
        BufferedReader fin = new BufferedReader(new FileReader(fileName));
        while (fin.ready()) {
            xml += fin.readLine();
        }
        fin.close();

        // parse the xml
        XMLParser parser = new XMLParser();
        BEASTInterface beastObject = parser.parseFragment(xml, true);

// find relevant objects from the model
        TreeLikelihood treeLikelihood = getTreeLikelihood(beastObject);
        if (treeLikelihood == null) {
            throw new IllegalArgumentException("No treelikelihood found in file. Giving up now.");
        }
        Alignment data = ((Input<Alignment>) treeLikelihood.getInput("data")).get();
        int tipCount = data.getTaxonCount();
        int siteCount = data.getSiteCount();
        System.out.println("Load original alignment: tips = " + tipCount + ", nucleotides = " + siteCount);

        return data;
    }

    public Alignment filterAlig(Alignment data, int nTaxa, int nCodon) {
        int tipCount = data.getTaxonCount();
        int siteCount = data.getSiteCount();
        //subset
        if (nTaxa < tipCount || nCodon * 3 < siteCount) {
            List<Sequence> sequenceList = data.sequenceInput.get();
            List<Sequence> newSeqs = new ArrayList<>();
            for (int i = 0; i < sequenceList.size(); i++) {
                Sequence sequence = sequenceList.get(i);
                String taxon = sequence.getTaxon();
                String seq = sequence.getData();
                assert seq.length() % 3 == 0;
                // t128
                int ind = Integer.parseInt(taxon.substring(1));

                if (ind <= nTaxa) {
                    if (nCodon * 3 < siteCount) {
                        // chop length = nCodon * 3
                        seq = seq.substring(0, nCodon*3);
                    }
                    newSeqs.add(new Sequence(taxon, seq));
                }
            }
            System.out.println("Filtered alignment: tips = " + data.getTaxonCount() + ", nucleotides = " + data.getSiteCount());

            return new Alignment(newSeqs, data.getDataType().toString());
        } else {
            return new Alignment(data.sequenceInput.get(), data.getDataType().toString());
        }
    }

    /**
     * find a treelikelihood object among the plug-ins by recursively inspecting plug-ins *
     */
    public TreeLikelihood getTreeLikelihood(BEASTInterface beastObject)  {
        for (BEASTInterface beastObject2 : beastObject.listActiveBEASTObjects()) {
            if (beastObject2 instanceof TreeLikelihood) {
                return (TreeLikelihood) beastObject2;
            } else {
                TreeLikelihood likelihood = getTreeLikelihood(beastObject2);
                if (likelihood != null) {
                    return likelihood;
                }
            }
        }
        return null;
    }


